import jsonfrom datetime import datetimedef dict_oper(filename):    """Распаковка json и создание нужного образца вывода"""    with open(filename, 'r') as f:        operations = json.load(f)    operation = []    for i in operations:        if not (i.get('from') and i.get('state')):            continue        if i['state'] == 'EXECUTED':            date = datetime.strptime(i['date'], '%Y-%m-%dT%H:%M:%S.%f')            date = date.strftime('%d.%m.%Y')            operation.append({'date': date,                              'description': i['description'],                              'from': i['from'],                              'to': i['to'],                              'operationAmount': i['operationAmount']                              })    return operationdef sort(filename):    """Сортировка по дате"""    sorted_list = sorted(filename, key=lambda x: datetime.strptime(x['date'], '%d.%m.%Y'), reverse=True)    return sorted_list[:5]def format_from_number(from_number):    """Маскировка номера отправителя"""    parts = from_number.split()    sender_name = " ".join(parts[:-1])    card_number = parts[-1]    formatted_number = " ".join([card_number[i:i + 4] for i in range(0, len(card_number), 4)])    if sender_name == "Счет":        formatted_number = '**' + card_number[-4:]    else:        formatted_number = formatted_number[:7] + "** **** " + formatted_number[-4:]    return f"{sender_name} {formatted_number}"def format_to_number(to_number):    """Маскировка номера получателя"""    parts = to_number.split()    sender_name = ''.join(parts[:-1])    card_number = parts[-1]    formatted_number = '**' + card_number[-4:]    return f'{sender_name} {formatted_number}'